import{_ as e,c as o,o as t,N as a}from"./chunks/framework.0799945b.js";const f=JSON.parse('{"title":"Tutorials","description":"","frontmatter":{},"headers":[],"relativePath":"tutorials/index.md"}'),r={name:"tutorials/index.md"},n=a('<h1 id="tutorials" tabindex="-1">Tutorials <a class="header-anchor" href="#tutorials" aria-label="Permalink to &quot;Tutorials&quot;">​</a></h1><h2 id="what-is-pando" tabindex="-1">What is Pando? <a class="header-anchor" href="#what-is-pando" aria-label="Permalink to &quot;What is Pando?&quot;">​</a></h2><p>Pando is a decentrialized financial network built with <a href="https://docs.pando.im/docs/security/mtg" target="_blank" rel="noreferrer">Mixin Trusted Group</a>, including a series of open financial protocols.</p><p>Based on the mechanism of trusted network, Pando combines most common decentralized financial applications into one product to serve users and is constantly evolving to provide more comprehensive financial services.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Just want to try it out? Skip to the <a href="./connect.html">Connect Wallet</a>.</p></div><h2 id="the-majorities-of-pando-protocols" tabindex="-1">The Majorities of Pando Protocols <a class="header-anchor" href="#the-majorities-of-pando-protocols" aria-label="Permalink to &quot;The Majorities of Pando Protocols&quot;">​</a></h2><p>There are 3 major protocols in Pando, including 4swap, Leaf and Rings.</p><ul><li><p><a href="https://pando.im/4swap" target="_blank" rel="noreferrer">4swap</a> is the first decentralized swapping protocol built on Mixin Network. It implements the AMM model and provides liquidity mining for users, which is compatible with Uniswap V2 and Curve. 4swap supports the &quot;trade&quot; function, also known as &quot;swap&quot;. It also supports the &quot;Liquidity Mining&quot; function at &quot;Earn&quot; page.</p></li><li><p><a href="https://pando.im/leaf" target="_blank" rel="noreferrer">Leaf</a> is a decentralized minting protocol built on Mixin Network. It uses the pledge mechanism that similar to MakerDAO and issues stablecoins called &quot;PUSD&quot;.</p></li><li><p><a href="https://pando.im/rings" target="_blank" rel="noreferrer">Rings</a> is a decentralized lending protocol built on Mixin Network. It implements compound V1 interest model and provides liquidity mining for users. Rings is not in development anymore and is keeping in minimal running.</p></li></ul><h2 id="other-pando-protocols-products" tabindex="-1">Other Pando Protocols/Products <a class="header-anchor" href="#other-pando-protocols-products" aria-label="Permalink to &quot;Other Pando Protocols/Products&quot;">​</a></h2><p>In addition to the three major protocols, Pando has a few other products and protocols, including:</p><ul><li><a href="https://pando.im/wallet" target="_blank" rel="noreferrer">Fennec</a>: An open source browser extension wallet based on Mixin Network, supporting Chrome and Firefox browsers.</li><li><a href="https://pando.im/talkee" target="_blank" rel="noreferrer">Talkee</a>: A Web3 comment and chat protocol, in addition to basic comment and chat functions, it also supports likes, rewards, and airdrops.</li><li><a href="https://pando.im/catkin" target="_blank" rel="noreferrer">Catkin</a>: A protocol for earning cryptocurrency for free. Users can receive cryptocurrency for free on Catkin, or earn cryptocurrency by completing tasks.</li></ul>',11),i=[n];function s(l,c,d,p,u,h){return t(),o("div",null,i)}const _=e(r,[["render",s]]);export{f as __pageData,_ as default};
